INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 155, "A", "獣人族", "トゥインクルウィッシュ", 2, "ヒヨリ", "人助けが大好き！　前向き格闘娘", 44, 16, "人助け、応援", 100101, 27, 8, "東山奈央");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 158, "O", "ヒューマン", "トゥインクルウィッシュ", 2, "ユイ", "戦闘のサポートが得意な、心優しい少女", 47, 17, "料理、人間観察", 100201, 5, 4, "種田梨沙");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 163, "B", "魔族", "トゥインクルウィッシュ", 2, "レイ", "クールで何事にも真っ直ぐな剣士", 46, 18, "読書、乗馬、お茶", 100301, 12, 1, "早見沙織");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 128, "O", "ヒューマン", "リトルリリカル", 5, "ミソギ", "探検好きのイタズラっ子", 27, 9, "いたずら、探検", 100401, 10, 8, "諸星すみれ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "？？？", 146, "O", "獣人族", "王宮騎士団（NIGHTMARE）", 8, "マツリ", "ヒーローに憧れる騎士見習いの少女", 40, 12, "ヒーローごっこ", 100501, 25, 11, "下田麻美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 150, "O", "魔族", "悪魔偽王国軍（ディアボロス）", 7, "アカリ", "甘え上手なみんなの人気者", 42, 13, "サックス", 100601, 22, 11, "浅倉杏美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 130, "B", "魔族", "悪魔偽王国軍（ディアボロス）", 7, "ミヤコ", "プリン大好きゴースト娘", 32, 14, "プリンを食べること", 100701, 23, 1, "雨宮天");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 150, "AB", "エルフ", "ヴァイスフリューゲル　ランドソル支部", 15, "ユキ", "ボクは誰よりも美しい", 40, 14, "鏡で自分を見ること", 100801, 10, 10, "大空直美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 159, "A", "魔族", "トワイライトキャラバン", 13, "アンナ", "前世を信じる中二病患者、「疾風の冥姫」", 45, 17, "小説執筆", 100901, 5, 7, "髙野麻美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 155, "O", "獣人族", "自警団（カォン）", 10, "マホ", "マホマホ王国のプリンセス", 42, 16, "空想、ぬいぐるみ集め", 101001, 22, 9, "内田真礼");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 156, "A", "ヒューマン", "ラビリンス", 3, "リノ", "人懐っこくてマシンガントークな妹系少女", 44, 15, "お裁縫", 101101, 25, 8, "阿澄佳奈");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 156, "A", "エルフ", "フォレスティエ", 6, "ハツネ", "みんなのために超能力を使う眠り姫", 46, 17, "妹と遊ぶこと、二度寝、昼寝、早寝", 101201, 24, 12, "大橋彩香");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 166, "O", "魔族", "トワイライトキャラバン", 13, "ナナカ", "オタク全開な魔法少女", 55, 18, "読書、魔法", 101301, 21, 8, "佳村はるか");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "test", 152, "AB", "獣人族", "自警団（カォン）", 10, "カスミ", "頭脳明晰な美少女名探偵", 41, 15, "読書、推理", 101401, 3, 11, "水瀬いのり");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "test", 165, "O", "エルフ", "フォレスティエ", 6, "ミサト", "母性溢れる優しいみんなの「ミサト先生」", 54, 21, "絵本作り", 101501, 5, 9, "國府田マリ子");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 167, "O", "魔族", "ルーセント学院", 14, "スズナ", "天真爛漫で人気者のカリスマモデル", 48, 18, "ファッション", 101601, 10, 4, "上坂すみれ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 158, "A", "獣人族", "自警団（カォン）", 10, "カオリ", "いつでも「なんくるないさ～」な天然娘", 53, 19, "踊り、空手", 101701, 7, 7, "高森奈津美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 162, "B", "魔族", "ルーセント学院", 14, "イオ", "多くの男性を魅了する無垢な女教師", 52, 23, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 101801, 14, 8, "伊藤静");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 117, "O", "獣人族", "リトルリリカル", 5, "ミミ", "お歌もにんじんも、ウサギさんも大好き♪", 21, 10, "かわいいもの集め", 102001, 3, 4, "日高里菜");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 150, "B", "ヒューマン", "サレンディア救護院", 9, "クルミ", "泣き虫で臆病な守ってあげたい女の子", 40, 12, "観劇、おままごと", 102101, 9, 6, "植田佳奈");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 150, "O", "魔族", "悪魔偽王国軍（ディアボロス）", 7, "ヨリ", "人見知りであまのじゃくな女の子", 40, 13, "ゲーム全般", 102201, 22, 11, "原紗友里");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 148, "B", "ヒューマン", "サレンディア救護院", 9, "アヤネ", "ぷうきちといつも一緒！", 38, 14, "屋内でできる遊び", 102301, 10, 5, "芹澤優");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 154, "O", "ヒューマン", "サレンディア救護院", 9, "スズメ", "お嬢さまのためにがんばるドジっ娘メイド", 43, 15, "ご奉仕", 102501, 12, 12, "悠木碧");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "test", 144, "B", "獣人族", "牧場（エリザベスパーク）", 11, "リン", "遊びと睡眠が何より大事なぐうたら娘", 42, 17, "あんパン", 102601, 1, 1, "小岩井ことり");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 154, "B", "魔族", "トワイライトキャラバン", 13, "エリコ", "運命の相手に一途すぎる乙女", 43, 16, "実験、裁縫、料理", 102701, 30, 7, "橋本ちなみ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 156, "A", "エルフ", "サレンディア救護院", 9, "サレン", "救護院を経営する優しい庶民派お嬢様", 43, 17, "経営、お茶会", 102801, 4, 10, "堀江由衣");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 157, "B", "ヒューマン", "カルミナ", 4, "ノゾミ", "歌って踊れる大人気アイドル", 40, 17, "舞台鑑賞、ダンス", 102901, 24, 1, "日笠陽子");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 163, "O", "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 15, "ニノン", "トーゴクの神秘、オシエテクダサイ！", 51, 16, "忍法開発", 103001, 31, 8, "佐藤聡美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 157, "AB", "魔族", "悪魔偽王国軍（ディアボロス）", 7, "シノブ", "占いが得意な霊能少女", 42, 18, "占い", 103101, 22, 12, "大坪由佳");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 157, "AB", "ヒューマン", "メルクリウス財団", 12, "アキノ", "一人前の商人を目指すパワフルお嬢様", 45, 18, "慈善事業", 103201, 12, 3, "松嵜麗");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 142, "B", "ヒューマン", "牧場（エリザベスパーク）", 11, "マヒル", "みんなを笑顔にするお笑い牧場主", 35, 20, "漫才", 103301, 3, 3, "新田恵海");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 164, "A", "エルフ", "メルクリウス財団", 12, "ユカリ", "純情でほっとけない大人の女性", 55, 22, "ウインドーショッピング", 103401, 16, 3, "今井麻美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "test", 118, "A", "エルフ", "リトルリリカル", 5, "キョウカ", "礼儀正しくしっかり者のちびっ子優等生", 21, 8, "お勉強", 103601, 2, 2, "小倉唯");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "test", 149, "A", "ヒューマン", "王宮騎士団（NIGHTMARE）", 8, "トモ", "義理堅くてからかい好きな剣術少女", 43, 13, "剣術、年長者をからかう", 103701, 11, 8, "茅原実里");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 153, "A", "獣人族", "牧場（エリザベスパーク）", 11, "シオリ", "読書が趣味の病弱少女", 40, 14, "読書、お散歩", 103801, 3, 11, "小清水亜美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 158, "AB", "エルフ", "フォレスティエ", 6, "アオイ", "「友達」に憧れる、エルフの森の女の子", 44, 13, "友達作りのイメトレ", 104001, 6, 6, "花澤香菜");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 163, "O", "ヒューマン", "カルミナ", 4, "チカ", "人々を守るために歌う、唱喚士の少女", 46, 17, "各種楽器", 104201, 3, 6, "福原綾香");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 168, "O", "獣人族", "自警団（カォン）", 10, "マコト", "男勝りで情に厚いワイルド娘", 54, 17, "お菓子作り", 104301, 9, 8, "小松未可子");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "test", 172, "A", "魔族", "悪魔偽王国軍（ディアボロス）", 7, "イリヤ", "かつては夜を支配した最強の吸血鬼", 50, "??", "世界征服", 104401, 5, 5, "丹下桜");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 157, "AB", "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 15, "クウカ", "妄想大好き！　ほんとは照れ屋な女の子", 49, 18, "小説を読むこと", 104501, 19, 11, "長妻樹里");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 158, "AB", "獣人族", "メルクリウス財団", 12, "タマキ", "弱きを助け強きをくじく猫娘", 48, 18, "猫とたわむれること", 104601, 1, 3, "沼倉愛美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "？？？", 171, "A", "ヒューマン", "王宮騎士団（NIGHTMARE）", 8, "ジュン", "素顔を見せない冷静沈着な女性騎士", 50, 25, "格闘技、湯浴み", 104701, 25, 10, "川澄綾子");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 163, "O", "ヒューマン", "メルクリウス財団", 12, "ミフユ", "仕事も私事も効率優先な傭兵少女", 49, 20, "傭兵などのアルバイト", 104801, 11, 11, "田所あずさ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 168, "O", "ヒューマン", "ラビリンス", 3, "シズル", "お姉ちゃんがお世話してあげるからねっ！", 54, 18, "家事全般", 104901, 24, 10, "生天目仁美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 120, "A", "魔族", "ルーセント学院", 14, "ミサキ", "ちょっとおませな恋に恋する女の子", 22, 11, "ファッション誌鑑賞、コスメ集め", 105001, 3, 1, "久野美咲");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 166, "A", "ヒューマン", "トワイライトキャラバン", 13, "ミツキ", "実験が趣味の危険な科学者", 53, 27, "研究、実験", 105101, 7, 3, "三石琴乃");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 150, "A", "獣人族", "牧場（エリザベスパーク）", 11, "リマ", "乙女チックなもふもふアニマル", 100, 18, "毛繕い、お喋り", 105201, 14, 3, "徳井青空");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 140, "A", "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 15, "モニカ", "見た目も中身もお子ちゃまな異国の軍人", 33, 18, "お菓子屋通い", 105301, 28, 7, "辻あゆみ");
