INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", 156, "O", "ヒューマン", "？？？", "", "ジータ", "空への冒険を夢見る騎空士の少女", 45, 17, "冒険、おしゃべり", 105701, 10, 3, "金元寿子");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", 156, "O", "ヒューマン", "美食殿", 1, "ペコリーヌ", "いつも元気な腹ペコ少女", 46, 17, "食べ歩き、料理", 105801, 31, 3, "M・A・O");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 140, "B", "エルフ", "美食殿", 1, "コッコロ", "主を慕う、小さなガイド役", 35, 11, "瞑想、動植物の飼育", 105901, 11, 5, "伊藤美来");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 152, "A", "獣人族", "美食殿", 1, "キャル", "行き倒れの謎のネコミミ魔法使い", 39, 14, "猫と遊ぶ", 106001, 2, 9, "立花理香");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", 148, "O", "ヒューマン", "？？？", "", "ムイミ", "さまよえる謎の少女", 40, 16, "冒険、思い出話", 106101, 11, 8, "潘めぐみ");
