INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", 156, "O", "ヒューマン", "美食殿", 1, "ペコリーヌ（サマー）", "いつも元気な腹ペコ少女", 46, 17, "食べ歩き、料理", 107501, 31, 3, "M・A・O");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 140, "B", "エルフ", "美食殿", 1, "コッコロ（サマー）", "主を慕う、小さなガイド役", 35, 11, "瞑想、動植物の飼育", 107601, 11, 5, "伊藤美来");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 154, "O", "ヒューマン", "サレンディア救護院", 9, "スズメ（サマー）", "お嬢さまのためにがんばるドジっ娘メイド", 43, 15, "ご奉仕", 107701, 12, 12, "悠木碧");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 152, "A", "獣人族", "美食殿", 1, "キャル（サマー）", "行き倒れの謎のネコミミ魔法使い", 39, 14, "猫と遊ぶ", 107801, 2, 9, "立花理香");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 158, "AB", "獣人族", "メルクリウス財団", 12, "タマキ（サマー）", "弱きを助け強きをくじく猫娘", 48, 18, "猫とたわむれること", 107901, 1, 3, "沼倉愛美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 163, "O", "ヒューマン", "メルクリウス財団", 12, "ミフユ（サマー）", "仕事も私事も効率優先な傭兵少女", 49, 20, "傭兵などのアルバイト", 108001, 11, 11, "田所あずさ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 157, "AB", "魔族", "悪魔偽王国軍（ディアボロス）", 7, "シノブ（ハロウィン）", "占いが得意な霊能少女", 42, 18, "占い", 108101, 22, 12, "大坪由佳");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 130, "B", "魔族", "悪魔偽王国軍（ディアボロス）", 7, "ミヤコ（ハロウィン）", "プリン大好きゴースト娘", 32, 14, "プリンを食べること", 108201, 23, 1, "雨宮天");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 120, "A", "魔族", "ルーセント学院", 14, "ミサキ（ハロウィン）", "ちょっとおませな恋に恋する女の子", 22, 11, "ファッション誌鑑賞、コスメ集め", 108301, 3, 1, "久野美咲");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 163, "O", "ヒューマン", "カルミナ", 4, "チカ（クリスマス）", "人々を守るために歌う、唱喚士の少女", 46, 17, "各種楽器", 108401, 3, 6, "福原綾香");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 150, "B", "ヒューマン", "サレンディア救護院", 9, "クルミ（クリスマス）", "泣き虫で臆病な守ってあげたい女の子", 40, 12, "観劇、おままごと", 108501, 9, 6, "植田佳奈");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 148, "B", "ヒューマン", "サレンディア救護院", 9, "アヤネ（クリスマス）", "ぷうきちといつも一緒！", 38, 14, "屋内でできる遊び", 108601, 10, 5, "芹澤優");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 155, "A", "獣人族", "トゥインクルウィッシュ", 2, "ヒヨリ（ニューイヤー）", "人助けが大好き！　前向き格闘娘", 44, 16, "人助け、応援", 108701, 27, 8, "東山奈央");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 158, "O", "ヒューマン", "トゥインクルウィッシュ", 2, "ユイ（ニューイヤー）", "戦闘のサポートが得意な、心優しい少女", 47, 17, "料理、人間観察", 108801, 5, 4, "種田梨沙");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 163, "B", "魔族", "トゥインクルウィッシュ", 2, "レイ（ニューイヤー）", "クールで何事にも真っ直ぐな剣士", 46, 18, "読書、乗馬、お茶", 108901, 12, 1, "早見沙織");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 154, "B", "魔族", "トワイライトキャラバン", 13, "エリコ（バレンタイン）", "運命の相手に一途すぎる乙女", 43, 16, "実験、裁縫、料理", 109001, 30, 7, "橋本ちなみ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 168, "O", "ヒューマン", "ラビリンス", 3, "シズル（バレンタイン）", "お姉ちゃんがお世話してあげるからねっ！", 54, 18, "家事全般", 109101, 24, 10, "生天目仁美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 156, "AB", "ヒューマン", "？？？", "", "アン", "英霊と契約を結んだマナリアの天才王女", 55, 17, "読書", 109201, 1, 12, "日笠陽子");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 144, "O", "ヒューマン", "？？？", "", "ルゥ", "マナリア魔法学院の新入生", 45, 15, "食べること、眠ること", 109301, 4, 2, "こやまきみこ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 167, "B", "半人半竜", "？？？", "", "グレア", "人を超越した力を有す心優しい竜姫", 67, 17, "ピアノ", 109401, 3, 11, "福原綾香");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 157, "AB", "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 15, "クウカ（オーエド）", "妄想大好き！　ほんとは照れ屋な女の子", 49, 18, "小説を読むこと", 109501, 19, 11, "長妻樹里");
