INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 153, "AB", "ヒューマン", "カルミナ", 4, "ツムギ（ハロウィン）", "ファッション大好きなキュートガール", 45, 14, "裁縫", 113901, 7, 9, "木戸衣吹");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 163, "B", "魔族", "トゥインクルウィッシュ", 2, "レイ（ハロウィン）", "クールで何事にも真っ直ぐな剣士", 46, 18, "読書、乗馬、お茶", 114001, 12, 1, "早見沙織");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 146, "O", "獣人族", "王宮騎士団（NIGHTMARE）", 8, "マツリ（ハロウィン）", "ヒーローに憧れる騎士見習いの少女", 40, 12, "ヒーローごっこ", 114101, 25, 11, "下田麻美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 140, "A", "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 15, "モニカ（マジカル）", "見た目も中身もお子ちゃまな異国の軍人", 33, 18, "お菓子屋通い", 114201, 28, 7, "辻あゆみ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 149, "A", "ヒューマン", "王宮騎士団（NIGHTMARE）", 8, "トモ（マジカル）", "義理堅くてからかい好きな剣術少女", 43, 13, "剣術、年長者をからかう", 114301, 11, 8, "茅原実里");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 157, "AB", "ヒューマン", "メルクリウス財団", 12, "アキノ（クリスマス）", "一人前の商人を目指すパワフルお嬢様", 45, 18, "慈善事業", 114401, 12, 3, "松嵜麗");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 156, "A", "エルフ", "サレンディア救護院", 9, "サレン（クリスマス）", "救護院を経営する優しい庶民派お嬢様", 43, 17, "経営、お茶会", 114501, 4, 10, "堀江由衣");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 164, "A", "エルフ", "メルクリウス財団", 12, "ユカリ（クリスマス）", "純情でほっとけない大人の女性", 55, 22, "ウインドーショッピング", 114601, 16, 3, "今井麻美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", 148, "O", "ヒューマン", "？？？", "", "ムイミ（ニューイヤー）", "さまよえる謎の少女", 40, 16, "冒険、思い出話", 114701, 11, 8, "潘めぐみ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 149, "O", "エルフ", "？？？", "", "ネネカ（ニューイヤー）", "研究所に隠れ住む物静かなお姉さん", "??", 24, "物真似、芸術鑑賞", 115001, 24, 3, "井口裕香");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 140, "B", "エルフ", "美食殿", 1, "コッコロ（儀装束）", "主を慕う、小さなガイド役", 35, 11, "瞑想、動植物の飼育", 115501, 11, 5, "伊藤美来");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 158, "O", "ヒューマン", "トゥインクルウィッシュ", 2, "ユイ（儀装束）", "戦闘のサポートが得意な、心優しい少女", 47, 17, "料理、人間観察", 115601, 5, 4, "種田梨沙");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 152, "AB", "獣人族", "自警団（カォン）", 10, "カスミ（サマー）", "頭脳明晰な美少女名探偵", 41, 15, "読書、推理", 115701, 3, 11, "水瀬いのり");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 150, "A", "獣人族", "牧場（エリザベスパーク）", 11, "リマ（シンデレラ）", "乙女チックなもふもふアニマル", 100, 18, "毛繕い、お喋り", 115801, 14, 3, "徳井青空");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 168, "O", "獣人族", "自警団（カォン）", 10, "マコト（シンデレラ）", "男勝りで情に厚いワイルド娘", 54, 17, "お菓子作り", 115901, 9, 8, "小松未可子");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 155, "O", "獣人族", "自警団（カォン）", 10, "マホ（シンデレラ）", "マホマホ王国のプリンセス", 42, 16, "空想、ぬいぐるみ集め", 116001, 22, 9, "内田真礼");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 154, "O", "エルフ", "聖テレサ女学院（なかよし部）", 16, "クロエ（聖学祭）", "ダウンタウン育ちのダウナー系エルフ", 42, 17, "ダーツ", 116201, 7, 8, "種﨑敦美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 156, "O", "ヒューマン", "聖テレサ女学院（なかよし部）", 16, "チエル（聖学祭）", "自由奔放ナチュラル無礼な現代っ子", 46, 16, "ダンス、カラオケ", 116301, 15, 9, "佐倉綾音");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 142, "O", "ヒューマン", "聖テレサ女学院（なかよし部）", 16, "ユニ（聖学祭）", "書庫に眠れる小さな賢人", 36, 18, "読書", 116401, 28, 2, "小原好美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 145, "AB", "ドラゴン族", "ドラゴンズネスト", 17, "イノリ（タイムトラベル）", "口が達者なヘタレドラゴン", "???", 13, "ゲーム", 116501, 29, 9, "藤田茜");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 156, "B", "ドラゴン族", "ドラゴンズネスト", 17, "カヤ（タイムトラベル）", "拳で語る喧嘩屋ドラゴン少女", "???", 16, "格闘技", 116601, 25, 6, "小市眞琴");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 158, "AB", "エルフ", "フォレスティエ", 6, "アオイ（作業服）", "「友達」に憧れる、エルフの森の女の子", 44, 13, "友達作りのイメトレ", 116701, 6, 6, "花澤香菜");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 158, "AB", "獣人族", "メルクリウス財団", 12, "タマキ（作業服）", "弱きを助け強きをくじく猫娘", 48, 18, "猫とたわむれること", 116801, 1, 3, "沼倉愛美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 163, "O", "ヒューマン", "メルクリウス財団", 12, "ミフユ（作業服）", "仕事も私事も効率優先な傭兵少女", 49, 20, "傭兵などのアルバイト", 116901, 11, 11, "田所あずさ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 154, "B", "魔族", "トワイライトキャラバン", 13, "エリコ（サマー）", "運命の相手に一途すぎる乙女", 43, 16, "実験、裁縫、料理", 117001, 30, 7, "橋本ちなみ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 168, "O", "ヒューマン", "ラビリンス", 3, "シズル（サマー）", "お姉ちゃんがお世話してあげるからねっ！", 54, 18, "家事全般", 117101, 24, 10, "生天目仁美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 157, "B", "ヒューマン", "カルミナ", 4, "ノゾミ（サマー）", "歌って踊れる大人気アイドル", 40, 17, "舞台鑑賞、ダンス", 117201, 24, 1, "日笠陽子");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 163, "O", "ヒューマン", "カルミナ", 4, "チカ（サマー）", "人々を守るために歌う、唱喚士の少女", 46, 17, "各種楽器", 117301, 3, 6, "福原綾香");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 153, "AB", "ヒューマン", "カルミナ", 4, "ツムギ（サマー）", "ファッション大好きなキュートガール", 45, 14, "裁縫", 117401, 7, 9, "木戸衣吹");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 166, "A", "ヒューマン", "トワイライトキャラバン", 13, "ミツキ（オーエド）", "実験が趣味の危険な科学者", 53, 27, "研究、実験", 117501, 7, 3, "三石琴乃");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 150, "AB", "エルフ", "ヴァイスフリューゲル　ランドソル支部", 15, "ユキ（オーエド）", "ボクは誰よりも美しい", 40, 14, "鏡で自分を見ること", 117601, 10, 10, "大空直美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 158, "A", "獣人族", "自警団（カォン）", 10, "カオリ（ハロウィン）", "いつでも「なんくるないさ～」な天然娘", 53, 19, "踊り、空手", 117701, 7, 7, "高森奈津美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 163, "O", "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 15, "ニノン（ハロウィン）", "トーゴクの神秘、オシエテクダサイ！", 51, 16, "忍法開発", 117801, 31, 8, "佐藤聡美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 167, "O", "魔族", "ルーセント学院", 14, "スズナ（ハロウィン）", "天真爛漫で人気者のカリスマモデル", 48, 18, "ファッション", 117901, 10, 4, "上坂すみれ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 160, "A", "ヒューマン", "リッチモンド商工会", 18, "クレジッタ", "忠義に目覚めた女商人", 57, 26, "お金を数えること、悪だくみ", 118001, 19, 9, "Lynn");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 165, "O", "魔族", "レイジ・レギオン", 19, "ランファ", "静寂を求め歌う陰気少女", 53, 20, "歌、読書、詩を書くこと", 118101, 28, 12, "原田彩楓");
