INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 162, "B", "魔族", "ルーセント学院", 14, "イオ（ノワール）", "多くの男性を魅了する無垢な女教師", 52, 23, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 119001, 14, 8, "伊藤静");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 157, "AB", "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 15, "クウカ（ノワール）", "妄想大好き！　ほんとは照れ屋な女の子", 49, 18, "小説を読むこと", 119101, 19, 11, "長妻樹里");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 142, "B", "ヒューマン", "牧場（エリザベスパーク）", 11, "マヒル（クリスマス）", "みんなを笑顔にするお笑い牧場主", 35, 20, "漫才", 119201, 3, 3, "新田恵海");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 156, "A", "ヒューマン", "ラビリンス", 3, "リノ（クリスマス）", "人懐っこくてマシンガントークな妹系少女", 44, 15, "お裁縫", 119301, 25, 8, "阿澄佳奈");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 130, "B", "魔族", "悪魔偽王国軍（ディアボロス）", 7, "ミヤコ（クリスマス）", "プリン大好きゴースト娘", 32, 14, "プリンを食べること", 119901, 23, 1, "雨宮天");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 168, "O", "ヒューマン", "ラビリンス", 3, "シズル（ノワール）", "お姉ちゃんがお世話してあげるからねっ！", 54, 18, "家事全般", 120001, 24, 10, "生天目仁美");
