INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 150, "B", "ヒューマン", "サレンディア救護院", 9, "クルミ（ステージ）", "泣き虫で臆病な守ってあげたい女の子", 40, 12, "観劇、おままごと", 121301, 9, 6, "植田佳奈");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 120, "A", "魔族", "ルーセント学院", 14, "ミサキ（ステージ）", "ちょっとおませな恋に恋する女の子", 22, 11, "ファッション誌鑑賞、コスメ集め", 121401, 3, 1, "久野美咲");
