INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 145, "AB", "ドラゴン族", "ドラゴンズネスト", 17, "イノリ（怪盗）", "口が達者なヘタレドラゴン", "???", 13, "ゲーム", 121601, 29, 9, "藤田茜");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 159, "A", "魔族", "トワイライトキャラバン", 13, "アンナ（パイレーツ）", "前世を信じる中二病患者、「疾風の冥姫」", 45, 17, "小説執筆", 121901, 5, 7, "髙野麻美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 157, "AB", "魔族", "悪魔偽王国軍（ディアボロス）", 7, "シノブ（パイレーツ）", "占いが得意な霊能少女", 42, 18, "占い", 122001, 22, 12, "大坪由佳");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 158, "AB", "エルフ", "フォレスティエ", 6, "アオイ（キャンプ）", "「友達」に憧れる、エルフの森の女の子", 44, 13, "友達作りのイメトレ", 122101, 6, 6, "花澤香菜");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 164, "A", "エルフ", "メルクリウス財団", 12, "ユカリ（キャンプ）", "純情でほっとけない大人の女性", 55, 22, "ウインドーショッピング", 122201, 16, 3, "今井麻美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 149, "AB", "魔族", "？？？", "", "ヴァンピィ", "けんぞくのご主人様", 41, "??", "お散歩、お料理", 122301, "?", "?", "釘宮理恵");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 155, "A", "獣人族", "トゥインクルウィッシュ", 2, "ヒヨリ（サマー）", "人助けが大好き！　前向き格闘娘", 44, 16, "人助け、応援", 122401, 27, 8, "東山奈央");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 163, "B", "魔族", "トゥインクルウィッシュ", 2, "レイ（サマー）", "クールで何事にも真っ直ぐな剣士", 46, 18, "読書、乗馬、お茶", 122501, 12, 1, "早見沙織");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 158, "O", "ヒューマン", "トゥインクルウィッシュ", 2, "ユイ（サマー）", "戦闘のサポートが得意な、心優しい少女", 47, 17, "料理、人間観察", 122601, 5, 4, "種田梨沙");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 118, "A", "エルフ", "リトルリリカル", 5, "キョウカ（サマー）", "礼儀正しくしっかり者のちびっ子優等生", 21, 8, "お勉強", 122701, 2, 2, "小倉唯");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 128, "O", "ヒューマン", "リトルリリカル", 5, "ミソギ（サマー）", "探検好きのイタズラっ子", 27, 9, "いたずら、探検", 122801, 10, 8, "諸星すみれ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 117, "O", "獣人族", "リトルリリカル", 5, "ミミ（サマー）", "お歌もにんじんも、ウサギさんも大好き♪", 21, 10, "かわいいもの集め", 122901, 3, 4, "日高里菜");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "", 150, "?", "？？？", "？？？", "", "アメス", "新たな姿で騎士の冒険を支え続ける妖精", "???", "??", "？？？", 123001, "?", "?", "相坂優歌");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 155, "O", "獣人族", "自警団（カォン）", 10, "マホ（エクスプローラー）", "マホマホ王国のプリンセス", 42, 16, "空想、ぬいぐるみ集め", 123101, 22, 9, "内田真礼");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 148, "B", "ヒューマン", "サレンディア救護院", 9, "アヤネ（エクスプローラー）", "ぷうきちといつも一緒！", 38, 14, "屋内でできる遊び", 123201, 10, 5, "芹澤優");
