INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 150, "O", "魔族", "悪魔偽王国軍（ディアボロス）", 7, "アカリ（クリスマス）", "甘え上手なみんなの人気者", 42, 13, "サックス", 124001, 22, 11, "浅倉杏美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 150, "O", "魔族", "悪魔偽王国軍（ディアボロス）", 7, "ヨリ（クリスマス）", "人見知りであまのじゃくな女の子", 40, 13, "ゲーム全般", 124101, 22, 11, "原紗友里");
