INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 166, "A", "ヒューマン", "トワイライトキャラバン", 13, "ミツキ（ニューイヤー）", "実験が趣味の危険な科学者", 53, 27, "研究、実験", 124701, 7, 3, "三石琴乃");
