INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", 148, "O", "ヒューマン", "？？？", "", "ムイミ（リベレイター）", "さまよえる謎の少女", 40, 16, "冒険、思い出話", 125001, 11, 8, "潘めぐみ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 158, "AB", "獣人族", "メルクリウス財団", 12, "タマキ（カフェ）", "弱きを助け強きをくじく猫娘", 48, 18, "猫とたわむれること", 125101, 1, 3, "沼倉愛美");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 140, "A", "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 15, "モニカ（カフェ）", "見た目も中身もお子ちゃまな異国の軍人", 33, 18, "お菓子屋通い", 125201, 28, 7, "辻あゆみ");
