INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 163, "B", "魔族", "トゥインクルウィッシュ", 2, "レイ（プリンセス）", "クールで何事にも真っ直ぐな剣士", 46, 18, "読書、乗馬、お茶", 180301, 12, 1, "早見沙織");
